import React, { useEffect } from "react";

const useState = initialValue => {
	let value = initialValue;

	const setValue = newValue => {
		value = newValue;
	};

	return [value, setValue];
};

const Test = () => {
	let [count, setCount] = useState(0);
	console.log(count, setCount);
	return (
		<div>
			<h1>{count}</h1>
			<button
				onClick={() => {
					setCount(count + 1);
				}}
			>
				Increment
			</button>
		</div>
	);
};

export default Test;
